function capFirstLetter(string) {
  return string.charAt(0).toUpperCase() + string.slice(1);
}

var JeachLoremIpsum = (function() {
  // private members
  const BUNDLES = {};
  
  // public members
  return {    
    // Get consecutive 'count' paragraphs...
    getParagraphs: function(count) {
      var p = [];      
      for (var i=0; i<count; i++) {
        p.push(TEXT[i]); 
      }      
      return p.join(' ');
    },
    
    getRandomParagraphs: function(count) {
      var p = [];      
      for (var i=0; i<count; i++) {
        var len = TEXT.length;
        var idx = Math.floor(Math.random() * len);
        p.push(TEXT[idx]);
      }      
      return p.join(' ');
    },
    
    getRandomTitle: function(count) {
      var c = arguments.length > 0 ? count : Math.floor(Math.random() * 5) + 2;
      var p = JeachLoremIpsum.getRandomParagraphs(2);
      var t = p.split(' ');
      var l =  t.length;
      var w = [];
      
      if (c < 1) c = 1;      
      
      for (var i=0; i<c; i++) {
        var idx = Math.floor(Math.random() * l);
        var x = t[idx];
        x = x.replace(/[.,]/, '');
        x = capFirstLetter(x);
        w.push(x);
      }
      
      return w.join(' ');
    },
    
    getRandomText: function(words) {
      var c = arguments.length > 0 ? words : Math.floor(Math.random() * 100) + 15;
      var p = JeachLoremIpsum.getRandomParagraphs(20);
      var t = p.split(' ');
      var l =  t.length;
      var w = [];      
      
      if (c < 1) c = 1;      
      
      for (var i=0; i<c; i++) {
        var idx = Math.floor(Math.random() * l);
        var x = t[idx];
        if (i === 0) x = capFirstLetter(x);
        if (i < 5) x = x.replace(/[.,]/, '');
        w.push(x);
      }
      
      w.push('.');
      
      return w.join(' ');
    }
  };
})();

module.exports = JeachLoremIpsum;

